import React from 'react';

const AppNavbar = () => {
  return (
    <div>
      <nav className="navbar bg-body-tertiary">
        <div className="container-fluid">
          <a className="navbar-brand brand-text" href="#">
            <img
              src="/images/logo.png"
              alt="Logo"
              width="70"
              height="70"
              className="d-inline-block align-text-middle"
            />
            MediQ
          </a>
        </div>
      </nav>
    </div>
  );
};

export default AppNavbar;
